  false,\n\t\"url\": null,\n\t\"notes\": \"The RGB/CIR ONE-foot orthophotos to be
  mapped consists of 4,362 cells (approximately 3,912 square miles) flown with a Z/I
  Intergraph DMC airborne digital sensor. The flight season was from December 1, 2009
  through March 15, 2010. The flight dates are as follows: December 29, 2009; December
  30, 2009; January 2, 2010; January 4, 2010; and January 6, 2010. All images were
  collected between 10:00 AM to 2:30 PM to minimize shadows. All images were obtained
  under cloud free conditions.\",\n\t\"owner_org\": \"b0b4c45b-a8ca-416b-b463-ee90d0a1a3df\",\n\t\"extras\":
